One of the main features of OOP is inheritance. Inheritance allows you to define a class that extends an existing class, which means your class will inherit the properties and methods of that other class. Every class you write extends exactly one other class: either the class you specify, or the Object class if you don't specify anything. Inheritance creates a hierarchy among all classes in a program. The Object class is the root of that hierarchy, with every other class either extending Object or one of its subclasses. Before we continue, let's define a few new terms: Extend : The Java keyword used to state that one class inherits from another. If class B extends class A, then class B inherits all of the variables and methods defined in class A. Subclass : A class that extends another class or one of its subclasses. If class B extends class A, then B is a subclass of A. If class C extends class B, then it is a subclass of both A and B. Superclass : A class that is extended by another class or by one of its superclasses. In the previous example with classes A, B, and C, A is the superclass of both B and C, and B is the superclass of C. Example classes from the above definitions: // A implicitly extends Object because it does not state which class it extends
// A is a subclass of Object, and it is the superclass of B and C
class A {} // B explicitly extends A
// B is a subclass of Object and A, and it is the superclass of C
class B extends A {} // C explicitly extends B
// C is a subclass of Object, A, and B
class C extends B {}

