If a class inherits a method from another class, then it can provide its own implementation of this method that differs from the implementation in its superclass. This is called overriding . The signature of the new implementation must be identical to the inherited method you wish to override. When overriding a method, it's good to mark the method with the @Override annotation. This will generate a compilation error if you do not correctly override the method. Without this, you may not realize that you haven't overridden the method and have a more difficulty time finding the bug. It is common to override the toString and equals methods that every class inherits from Object. These allow you to print your object in a readable form and use equals to compare different instances and determine whether they are equivalent. The example below demonstrates this: public class Point { private int x, y; public Point(int initX, int initY) { x = initX; y = initY; } @Override public String toString() { return String.format("(%d,%d)", x, y); } @Override public boolean equals(Object other) { if (other == null || !(other instanceof Point)) { return false; } // must perform a typecast to treat the other object as a point Point otherPoint = (Point) other; return x == otherPoint.x && y == otherPoint.y; }
} public class Main { public static void main(String[] args) { Point a = new Point(1, 2); Point b = new Point(3, 4); Point c = new Point(1, 2); // printing or concatenating an object automatically calls its toString // method, giving us more readable output System.out.println("a: " + a); System.out.println("b: " + b); System.out.println("c: " + c); // comparing references results in false for equivalent points System.out.println("a == c results in: " + (a == c)); // comparing with .equals results in true for equivalent points System.out.println("a.equals(c) results in: " + a.equals(c)); }
}

