Every class must have at least one constructor, and a class does not inherit any constructors from its superclass [1] . However, Java will add a default constructor (one with no parameters) for you in the following situation: Your superclass defines a default constructor Your class does not explicitly define a constructor Every constructor in Java also starts by calling a constructor in its superclass. You can do this explicitly with the super keyword, but Java will add a call to the superclass's default constructor for you in the following situation: Your superclass defines a default constructor Your constructor does not explicitly call a constructor from the superclass The following example demonstrates what Java adds for you: // minimal class
public class A {} // equivalent class, but explicitly showing what the compiler adds
public class A extends Object { // compiler would have extended Object for us public A() { // compiler would have added default constructor for us super(); // compiler would have called super() for us }
} // another class
public class B extends Object { public B() { System.out.println("B"); }
} // and the equivalent with compiler addition
public class B extends Object { public B() { super(); // compiler would have called super() for us System.out.println("B"); }
}

