Access modifiers determine which parts of a program have access to something. We've already used public and private, but there is also a protected access modifier and the default "package private" level of access you get with no modifier. To describe these access levels: public members can be accessed from anywhere protected members can be accessed from their class, package, or a subclass "package private" (no modifier) members can be accessed from their class or package private members can only be accessed from their class These access modifiers allow us to encapsulate code: hide implementation details from users (other programmers) of a class and only expose the portions of the class they need in order to use it. Oracle's access control tutorial explains these in more detail. Below is a table from the tutorial summarizing the different access modifiers. Modifier Class Package Subclass World public Yes Yes Yes Yes protected Yes Yes Yes No no modifier Yes Yes No No private Yes No No No The tutorial also includes a small diagram with a class fitting each of the above categories (class, package, subclass, world). I've included code below for classes that fit the diagram and demonstrate where a variable with each modifier can be accessed. // file: one/Alpha.java
package one; public class Alpha { public int a = 1; protected int b = 2; int c = 3; private int d = 4; public static void main(String[] args) { Alpha example = new Alpha(); // can access everything from inside of MyClass System.out.println(example.a); System.out.println(example.b); System.out.println(example.c); System.out.println(example.d); }
} // file: one/Beta.java
package one; public class Beta { public static void main(String[] args) { Alpha example = new Alpha(); // can access public, protected, and no modifier from another class in the same package System.out.println(example.a); System.out.println(example.b); System.out.println(example.c); // cannot access private from another class in the same package // System.out.println(example.d); }
} // file: two/AlphaSub.java
package two; public class AlphaSub extends one.Alpha { public static void main(String[] args) { one.Alpha example = new one.Alpha(); // can access public and protected from a subclass class in another package System.out.println(example.a); System.out.println(example.b); // cannot access no modifier and private from a subclass class in another package // System.out.println(example.c); // System.out.println(example.d); }
} // file: two/Gamma.java
package two; public class Gamma { public static void main(String[] args) { one.Alpha example = new one.Alpha(); // can only access public from an unrelated class in another package System.out.println(example.a); // cannot access protected, no modifier, or private from an unrelated class in another package // System.out.println(example.b); // System.out.println(example.c); // System.out.println(example.d); }
}

