We've also seen the static modifier before. A static member belongs to the class as a whole, whereas a non-static (instance) member belongs to instances of the class, each of which has its own copy of the non-static member. We often use the static modifier when we want to write a method that can be called without an instance of its class. We access static members by typing the class name rather than the name of an instance of that class. We also use the static modifier when creating constants . If you've used the Math class before, then you already know how to access static methods and variables: // We access the static constant PI and static method pow through the Math class:
double piSquared = Math.pow(Math.PI, 2); // It would be strange if we had to instantiate Math to access its constants and methods:
Math m = new Math();
double piSquared = m.pow(m.PI, 2);

