Like inheritance, composition is another technique that allows us to reuse code. Instead of extending a common superclass, we can put the code we want to reuse in a separate class and include an instance of that separate class as a property. For example, we might want classes for a Student and Worker. Both classes will have a bank account, and we would like to avoid duplicating the code for managing the bank account. An inheritance solution might look like this: public class PersonWithBankAccount { private int balance; public void deposit(int amount) { balance += amount; } public int withdraw(int amount) { if (balance >= amount) { balance -= amount; return amount; } else { return 0; } }
}
public class Student extends PersonWithBankAccount { public void buyTextbook(int cost) { int cash = withdraw(cost); if (cash == cost) { System.out.println("Bought the books."); } else { System.out.println("Couldn't buy the books."); } }
}
public class Worker extends PersonWithBankAccount { public void depositPaycheck(int amount) { deposit(amount); System.out.println("Deposited paycheck."); }
} A composition solution would look like this: public class BankAccount { private int balance; public void deposit(int amount) { balance += amount; } public int withdraw(int amount) { if (balance >= amount) { balance -= amount; return amount; } else { return 0; } }
}
public class Student { private BankAccount account; public void buyTextbook(int cost) { int cash = account.withdraw(cost); if (cash == cost) { System.out.println("Bought the books."); } else { System.out.println("Couldn't buy the books."); } }
}
public class Worker { private BankAccount account; public void depositPaycheck(int amount) { account.deposit(amount); System.out.println("Deposited paycheck."); }
} This is a simple example, and there's not a huge difference between the two versions. However, on a larger scale, we can encounter some problems with the inheritance version. Remember that each class extends exactly one other class. What if we want to reuse code from two different classes? If these classes are in different parts of the class hierarchy, then we can't extend both of them. Composition doesn't have this limitation.

